INSERT INTO `project_node_templates` (`id`, `name`, `description`, `project_template_id`, `project_template_type`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 'STANDAR 1: VISI, MISI, TUJUAN DAN SASARAN, SERTA STRATEGI PENCAPAIAN', 'STANDAR 1: VISI, MISI, TUJUAN DAN SASARAN, SERTA STRATEGI PENCAPAIAN', 1, 'App\\ProjectTemplate', '2015-12-12 04:53:55', '2015-12-12 19:33:59', '2015-12-12 19:33:59'),
(2, 'Kejelasan,  kerealistikan, dan keterkaitan antar visi, misi, tujuan dan sasaran perguruan tinggi, dan pemangku kepentingan yang terlibat.', '1.1. Kejelasan,  kerealistikan, dan keterkaitan antar visi, misi, tujuan dan sasaran perguruan tinggi, dan pemangku kepentingan yang terlibat.', 1, 'App\\ProjectNodeTemplate', '2015-12-12 04:53:55', '2015-12-12 19:33:59', '2015-12-12 19:33:59'),
(3, 'Kejelasan dan kerealistikan visi, misi, tujuan, dan sasaran Program Studi', '1.1.a. Kejelasan dan kerealistikan visi, misi, tujuan, dan sasaran Program Studi', 2, 'App\\ProjectNodeTemplate', '2015-12-12 04:53:55', '2015-12-12 19:33:59', '2015-12-12 19:33:59'),
(4, 'Strategi pencapaian sasaran dengan rentang waktu yang jelas dan didukung oleh dokumen.', '1.1.b. Strategi pencapaian sasaran dengan rentang waktu yang jelas dan didukung oleh dokumen.', 2, 'App\\ProjectNodeTemplate', '2015-12-12 04:53:55', '2015-12-12 19:33:59', '2015-12-12 19:33:59'),
(5, 'Sosialisasi yang efektif tercermin dari tingkat pemahaman pihak terkait.', '1.2. Sosialisasi yang efektif tercermin dari tingkat pemahaman pihak terkait.', 1, 'App\\ProjectNodeTemplate', '2015-12-12 04:53:55', '2015-12-12 19:33:59', '2015-12-12 19:33:59'),
(6, 'STANDAR 2: TATA PAMONG, KEPEMIMPINAN, SISTEM PENGELOLAAN, DAN PENJAMINAN MUTU', 'STANDAR 2: TATA PAMONG, KEPEMIMPINAN, SISTEM PENGELOLAAN, DAN PENJAMINAN MUTU', 1, 'App\\ProjectTemplate', '2015-12-12 04:53:55', '2015-12-12 19:33:59', '2015-12-12 19:33:59'),
(7, 'Tatapamong menjamin terwujudnya visi, terlaksanakannya misi, tercapainya tujuan, berhasilnya strategi yang digunakan secara kredibel, transparan, akuntabel, bertanggung jawab, dan adil.', '2.1. Tatapamong menjamin terwujudnya visi, terlaksanakannya misi, tercapainya tujuan, berhasilnya strategi yang digunakan secara kredibel, transparan, akuntabel, bertanggung jawab, dan adil.', 6, 'App\\ProjectNodeTemplate', '2015-12-12 04:53:55', '2015-12-12 19:33:59', '2015-12-12 19:33:59'),
(8, 'Karakteristik kepemimpinan yang efektif.', '2.2. Karakteristik kepemimpinan yang efektif.', 6, 'App\\ProjectNodeTemplate', '2015-12-12 04:53:55', '2015-12-12 19:33:59', '2015-12-12 19:33:59'),
(9, 'Sistem pengelolaan fungsional dan operasional program studi mencakup: planning, organizing, staffing, leading, controlling yang efektif dilaksanakan.', '2.3. Sistem pengelolaan fungsional dan operasional program studi mencakup: planning, organizing, staffing, leading, controlling yang efektif dilaksanakan.', 6, 'App\\ProjectNodeTemplate', '2015-12-12 04:53:55', '2015-12-12 19:33:59', '2015-12-12 19:33:59'),
(10, 'Pelaksanaan penjaminan mutu di program studi.', '2.4. Pelaksanaan penjaminan mutu di program studi\nPelaksanaannya antara lain dengan adanya: kelompok dosen bidang ilmu yang menilai mutu soal ujian, silabus, dan tugas akhir, serta penguji luar (external examiner)', 6, 'App\\ProjectNodeTemplate', '2015-12-12 04:53:55', '2015-12-12 19:33:59', '2015-12-12 19:33:59'),
(11, 'Penjaringan umpan balik  dan tindak lanjutnya.', '2.5. Penjaringan umpan balik  dan tindak lanjutnya. Sumber umpan balik antara lain dari: (1) dosen, (2) mahasiswa, (3) alumni, (4) pengguna lulusan.', 6, 'App\\ProjectNodeTemplate', '2015-12-12 04:53:55', '2015-12-12 19:33:59', '2015-12-12 19:33:59'),
(12, 'Upaya-upaya yang telah dilakukan penyelenggara program studi untuk menjamin keberlanjutan.', '2.6. Upaya-upaya yang telah dilakukan penyelenggara program studi untuk menjamin keberlanjutan (sustainability) program studi ini antara lain mencakup:\na. Upaya untuk peningkatan animo calon mahasiswa\nb. Upaya peningkatan mutu manajemen\nc. Upaya untuk ', 6, 'App\\ProjectNodeTemplate', '2015-12-12 04:53:55', '2015-12-12 19:33:59', '2015-12-12 19:33:59'),
(13, 'STANDAR 3: MAHASISWA DAN LULUSAN', 'STANDAR 3: MAHASISWA DAN LULUSAN', 1, 'App\\ProjectTemplate', '2015-12-12 04:53:55', '2015-12-12 19:34:00', '2015-12-12 19:34:00'),
(14, '[tidak tahu]', '3.1. [tidak tahu]', 13, 'App\\ProjectNodeTemplate', '2015-12-12 04:53:55', '2015-12-12 19:34:00', '2015-12-12 19:34:00'),
(15, 'Efektivitas implementasi sistem rekrutmen dan seleksi calon mahasiswa untuk menghasilkan calon mahasiswa yang bermutu yang diukur dari jumlah peminat, proporsi pendaftar terhadap daya tampung dan proporsi yang diterima dan yang registrasi', '3.1.1. Efektivitas implementasi sistem rekrutmen dan seleksi calon mahasiswa untuk menghasilkan calon mahasiswa yang bermutu yang diukur dari jumlah peminat, proporsi pendaftar terhadap daya tampung dan proporsi yang diterima dan yang registrasi', 14, 'App\\ProjectNodeTemplate', '2015-12-12 04:53:55', '2015-12-12 19:33:59', '2015-12-12 19:33:59'),
(16, 'Penerimaan mahasiswa non-reguler selayaknya tidak membuat beban dosen sangat berat, jauh melebihi beban ideal  (sekitar 12 sks).', '3.1.2. Penerimaan mahasiswa non-reguler selayaknya tidak membuat beban dosen sangat berat, jauh melebihi beban ideal  (sekitar 12 sks).', 14, 'App\\ProjectNodeTemplate', '2015-12-12 04:53:55', '2015-12-12 19:33:59', '2015-12-12 19:33:59'),
(17, 'Penghargaan atas prestasi mahasiswa di bidang nalar, bakat dan minat', '3.1.3. Penghargaan atas prestasi mahasiswa di bidang nalar, bakat dan minat', 14, 'App\\ProjectNodeTemplate', '2015-12-12 04:53:55', '2015-12-12 19:33:59', '2015-12-12 19:33:59'),
(18, 'Profil lulusan: ketepatan waktu penyelesaian studi, proporsi mahasiswa yang menyelesaikan studi dalam batas masa studi', '3.1.4. Profil lulusan: ketepatan waktu penyelesaian studi, proporsi mahasiswa yang menyelesaikan studi dalam batas masa studi', 14, 'App\\ProjectNodeTemplate', '2015-12-12 04:53:55', '2015-12-12 19:34:00', '2015-12-12 19:34:00'),
(19, '[tidak tahu]', '3.2. [tidak tahu]', 13, 'App\\ProjectNodeTemplate', '2015-12-12 04:53:55', '2015-12-12 19:34:00', '2015-12-12 19:34:00'),
(20, 'Mahasiswa memiliki akses untuk mendapatkan pelayanan mahasiswa yang dapat dimanfaatkan untuk membina dan mengembangkan penalaran, minat, bakat, seni, dan kesejahteraan.', '3.2.1. Mahasiswa memiliki akses untuk mendapatkan pelayanan mahasiswa yang dapat dimanfaatkan untuk membina dan mengembangkan penalaran, minat, bakat, seni, dan kesejahteraan. \n\nJenis pelayanan kepada mahasiswa antara lain:\n1. Bimbingan dan konseling\n', 19, 'App\\ProjectNodeTemplate', '2015-12-12 04:53:55', '2015-12-12 19:34:00', '2015-12-12 19:34:00'),
(21, 'Kualitas layanan kepada mahasiswa', '3.2.2. Kualitas layanan kepada mahasiswa', 19, 'App\\ProjectNodeTemplate', '2015-12-12 04:53:55', '2015-12-12 19:34:00', '2015-12-12 19:34:00'),
(22, '[tidak tahu]', '3.3. [tidak tahu]', 13, 'App\\ProjectNodeTemplate', '2015-12-12 04:53:55', '2015-12-12 19:34:00', '2015-12-12 19:34:00'),
(23, '[tidak tahu]', '3.3.1. [tidak tahu]', 22, 'App\\ProjectNodeTemplate', '2015-12-12 04:53:55', '2015-12-12 19:34:00', '2015-12-12 19:34:00'),
(24, 'Upaya pelacakan dan perekaman data lulusan', '3.3.1.a. Upaya pelacakan dan perekaman data lulusan', 23, 'App\\ProjectNodeTemplate', '2015-12-12 04:53:55', '2015-12-12 19:34:00', '2015-12-12 19:34:00'),
(25, 'Penggunaan hasil pelacakan untuk perbaikan', '3.3.1.b. Penggunaan hasil pelacakan untuk perbaikan: \n(1) proses pembelajaran, \n(2) penggalangan dana, \n(3) informasi pekerjaan, \n(4) membangun jejaring.', 23, 'App\\ProjectNodeTemplate', '2015-12-12 04:53:55', '2015-12-12 19:34:00', '2015-12-12 19:34:00'),
(26, 'Pendapat pengguna (employer) lulusan terhadap kualitas alumni.', '3.3.1.c. Pendapat pengguna (employer) lulusan terhadap kualitas alumni.\nAda 7 jenis kompetensi.', 23, 'App\\ProjectNodeTemplate', '2015-12-12 04:53:55', '2015-12-12 19:34:00', '2015-12-12 19:34:00'),
(27, 'Profil masa tunggu kerja pertama', '3.3.2. Profil masa tunggu kerja pertama', 22, 'App\\ProjectNodeTemplate', '2015-12-12 04:53:55', '2015-12-12 19:34:00', '2015-12-12 19:34:00'),
(28, ' Profil kesesuaian bidang kerja dengan bidang studi', '3.3.3.  Profil kesesuaian bidang kerja dengan bidang studi', 22, 'App\\ProjectNodeTemplate', '2015-12-12 04:53:55', '2015-12-12 19:34:00', '2015-12-12 19:34:00'),
(29, '[tidak tahu]', '3.4. [tidak tahu]', 13, 'App\\ProjectNodeTemplate', '2015-12-12 04:53:55', '2015-12-12 19:34:00', '2015-12-12 19:34:00'),
(30, 'Partisipasi alumni dalam mendukung pengembangan akademik program studi.', '3.4.1. Partisipasi alumni dalam mendukung pengembangan akademik program studi dalam bentuk: \n(1) Sumbangan dana\n(2) Sumbangan fasilitas\n(3) Keterlibatan dalam kegiatan akademik\n(4) Pengembangan jejaring\n(5) Penyediaan fasilitas untuk kegiatan akademi', 29, 'App\\ProjectNodeTemplate', '2015-12-12 04:53:55', '2015-12-12 19:34:00', '2015-12-12 19:34:00'),
(31, 'Partisipasi lulusan dan alumni dalam mendukung pengembangan non-akademik program studi.', '3.4.2. Partisipasi lulusan dan alumni dalam mendukung pengembangan non-akademik program studi dalam bentuk: \n(1) Sumbangan dana\n(2) Sumbangan fasilitas\n(3) Keterlibatan dalam kegiatan akademik\n(4) Pengembangan jejaring \n(5) Penyediaan fasilitas untuk', 29, 'App\\ProjectNodeTemplate', '2015-12-12 04:53:55', '2015-12-12 19:34:00', '2015-12-12 19:34:00'),
