CREATE DEFINER=`root`@`localhost` FUNCTION `next_month`(
                `datetime` DATETIME,
                `date` INT
            ) RETURNS datetime
BEGIN
                DECLARE oldDate INT;
                DECLARE newDate DATETIME;
    
                SET oldDate = (
                    SELECT CAST(DATE_FORMAT(`datetime`, '%d') AS SIGNED)
                );
    
                IF (oldDate < `date`) THEN
                    RETURN DATE_ADD(`datetime`, INTERVAL (`date`-oldDate) DAY);
                ELSE
                    SET newDate = DATE_ADD(`datetime`, INTERVAL 1 MONTH);
                    SET newDate = DATE_SUB(`newDate`, INTERVAL ABS(oldDate - `date`) DAY);
                    RETURN newDate; 
                END IF;
            END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `next_weekday`(
                `date` DATETIME,
                `day` INT
            ) RETURNS datetime
BEGIN
            IF (WEEKDAY(`date`) = `day`) THEN
                RETURN DATE_ADD(`date`, INTERVAL 7 DAY);
            ELSE
                IF (WEEKDAY(`date`) < `day`) THEN   
                    RETURN DATE_ADD(`date`, INTERVAL (`day` - WEEKDAY(`date`)) DAY);
                ELSE
                    RETURN DATE_ADD(`date`, INTERVAL ( 7 - ABS(`day` - WEEKDAY(`date`))) DAY);
                END IF;
            END IF;
            END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `next_year`(
                `datetime` DATETIME
                , dateInput INT
                , monthInput INT
            ) RETURNS datetime
BEGIN
            DECLARE currentYearStart DATETIME;
            DECLARE curYear VARCHAR(255);
    
            SET curYear =  CONCAT(YEAR(CURRENT_TIMESTAMP), '-', monthInput, '-', dateInput);
    
            SET currentYearStart = (SELECT CAST(curYear AS DATETIME));
    
            IF (currentYearStart < CURRENT_TIMESTAMP) THEN
                RETURN DATE_ADD(currentYearStart, INTERVAL 1 YEAR);
            ELSE
                RETURN currentYearStart;
            END IF;
    
        END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `work_status`(
                userId INT
                , batchId INT
            ) RETURNS int(11)
BEGIN
                DECLARE total, stat INT;
    
                SET total = (
                    SELECT COUNT(DISTINCT `status`) 
                    FROM tasks
                    WHERE tasks.user_id = userId AND (tasks.batch_id = batchId)
                );
            
                IF (total > 1) THEN
                    RETURN 1;
                ELSE
                    SET stat = (
                        SELECT DISTINCT `status` 
                        FROM tasks
                        WHERE tasks.user_id = userId AND (tasks.batch_id = batchId)
                    );
                    
                    RETURN stat;
                END IF;
            END$$

